import React from 'react';

import Header from '../../components/01_sections/header/HomeHeader';
import Footer from '../../components/01_sections/footer';

function Retriever() {
  return (
    <div height="500px">
      <Header />
      <iframe
        src="https://noahsjung.com/works/retriever-app"
        // style="border: 0"
        position="fixed"
        top="0"
        left="0"
        right="0"
        bottom="0"
        width="100%"
        height="1000px"
        title="retriever-app"
      ></iframe>
      <Footer />
    </div>
  );
}

export default Retriever;
